const Header = (course) =>{
  console.log(course)
  return(
    <div>
      <h1>{course.name}</h1>
    </div>
  )
}

const Part = (element) =>{
  return(
    <div>
      <p>
        {element.part} {element.exercises}
      </p>
    </div>
  )
}

const Content = (parts) =>{
  return(
    <div>
      <Part part={parts.part1} exercises={parts.exercises1}/>
      <Part part={parts.part2} exercises={parts.exercises2}/>
      <Part part={parts.part3} exercises={parts.exercises3}/>
    </div>
  )
}

const Total = (number) =>{
  return(
    <div>
       <p>Number of exercises {number.exercises1 + number.exercises2 + number.exercises3}</p>
    </div>
  )
}

const App = () => {

  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }


  return (
    <div>
      <Header name={course} />
      <Content part1={part1.name} exercises1={part1.exercises}  part2={part2.name} exercises2={part2.exercises} 
      part3={part3.name} exercises3={part3.exercises} />
      <Total exercises1={part1.exercises} exercises2={part2.exercises} exercises3={part3.exercises} />
    </div>
  )
}

export default App
